// Framework (DAPSIWR) shape
joint.shapes.kb.Framework = joint.shapes.basic.Generic.extend({

    // this must be called after creating the node
    setup: function ()
    {
        // function to find and position Relationship node correctly
        // on any Causal Links connected to this node
        // called if the node's position changes
        this.on('change:position', function(element)
        {
            
            // get all links connected to this node
            var links = app.graph.getConnectedLinks(element);
            var llen = links.length;
            var i;
            // loop over the connected links
            for (i = 0; i < llen; i++) 
            {
                var linkID = links[i].id;
                // if the id of the link is defined
                if (linkID) 
                {
                    // get the link object
                    var link = app.graph.getCell(linkID);
                    // get the id of the Relationship node on the link
                    var relNodeID = link.get('relNodeID');
                    // if there is a Relationship node on the link, then
                    // relNodeID will be defined
                    if (relNodeID)
                    {
                        // get the Relationship node
                        var relNode = app.graph.getCell(relNodeID);			
                        // get the source node of the link
                        var sourceNodeID = link.get('source').id;
                        var sourceNode = app.graph.getCell(sourceNodeID);
                        // get the target node of the link
                        var targetNodeID = link.get('target').id;
                        var targetNode = app.graph.getCell(targetNodeID);
                        // calculate the midpoint between the nodes
                        var xc = (sourceNode.get('position').x + targetNode.get('position').x)/2 + relNode.get('size').width/2;
                        var yc = (sourceNode.get('position').y + targetNode.get('position').y)/2 + relNode.get('size').height/2;
                        // set the position of the Relationship node
                        relNode.position( xc,yc);
                    }
                }
            }
        });
    },
						  
    //markup: '<g class="rotatable"><g class="scalable"><circle class="root"/></g><text class="label"/><text class="name"/></g>',
    markup: '<g class="rotatable"><g class="scalable"><circle class="root"/><image/></g><text class="name"/></g>',
                                                             
    defaults: joint.util.deepSupplement({
                                     
        type: 'kb.Framework',
        size: { width: 60, height: 60 },
        attrs: {
            // default documnt image
            'image': { 'ref-x': 0.0, 'ref-y': -10,ref: 'circle', width: 60, height: 60 , 'xlink:href' : 'data:image/png;base64,'},

            '.root': {
                // the radius of the circle should be half the width of the node
                r: 30,
                fill: '#ffffff',
                stroke: '#ffffff',
                // the translation should be the same as the radius in x and y directions
                 transform: 'translate(30, 30)'
             },

            //'.label': {
                // position the label near, but not on, the centre of the circle
            //    ref: 'circle', 'ref-x': 0.5, 'ref-y': 0.3,
                //'font-family': 'Courier New',
            //    'font-size': 20,
            //    'font-weight': 'bold',
            //    'text': 'D',
            //    fill: '#000000',
            //    'text-anchor': 'middle'
            //},

            '.name': {
                // position the name text above the circle (doesn't work well below it)
                'ref-x': 0.5,
                'ref-y': -30.0,
                //ref: 'circle',
                ref: '.root',
                //'font-family': 'Courier New',
                'font-size': 14,
                'text-anchor': 'middle',
                'text': 'Driver',
                'fill': '#000000'
            }
        }
    }, joint.shapes.basic.Generic.prototype.defaults)
});
