// Causal Link link
joint.shapes.kb.CausalLink =  joint.dia.Link.extend({
		
    // this function must be called to set up the link properly after creation
    // The database id of the intermediate vertex is being passed to this function
    setup: function (intVertexDbId, setInvisible, noteProperty)
    {
        // create a Relationship node to sit on the link
        var relNode = new joint.shapes.kb.Rel ({
        // initial postion - recalculated below
            position: { x: 0, y: 0 },
            databaseId: intVertexDbId,
            xcoord:xc,
            ycoord:yc,
            attrs:
                {
                    '.label': { text: 'R' },
                    '.name' : { text: '' },
                    text: { classType: 'RelNode',
                            note: noteProperty
                        }
                },
         
        });
        
        // must add to graph to set id properly
        graph.addCell(relNode);
        
        // save the Relationship node id in this link
        this.set('relNodeID', relNode.id);
        // save the link id in the Relationship node
        relNode.set('linkID', this.id);		
        // get the source node
        var sourceNodeID = this.get('source').id;
        var sourceNode = graph.getCell(sourceNodeID);

        // get the target node
        var targetNodeID = this.get('target').id;
        var targetNode = graph.getCell(targetNodeID);
			
        // calculate the Relationship node position
        var xc = (sourceNode.get('position').x + targetNode.get('position').x)/2 + relNode.get('size').width/2;
      //modify the postion of the relNode to sit better on the casual link. will have to review depending on performance 
      //on other graphs25/02/2018
        xc = xc +6;
        var yc = (sourceNode.get('position').y + targetNode.get('position').y)/2 + relNode.get('size').height/2;
        //modify the postion of the relNode to sit better on the casual link. will have to review 
        yc = yc-14;
       
        // set the Relationship node position
        relNode.position(xc,yc);
        // set up the Relationship node properties and functions
        relNode.setup();
        
        // make Relationship node appear on top of the link
        relNode.toFront();
        relNode.attr("style", "visibility: hidden");
//        this.css("visibility","hidden");
        // disable the adding of vertices to the link
        this.on('change:vertices',function(element)
        {
                this.set('vertices',[]);
        });
			
       if(setInvisible === true){
           relNode.attr("./display","none");
       }
        
    },
    defaults: joint.util.deepSupplement({
    type: 'kb.CausalLink',
    // id of the Relationship node
    relNodeID : '',
    smooth : true,
        attrs : {
            '.connection': { stroke: '#00', 'stroke-width': 40 },
            '.marker-target': { fill: '#663300', stroke: '#663300', d: 'M 20 0 L 0 10 L 20 20 z' }
        }
    }, joint.dia.Link.prototype.defaults)
});

// Returns an array of IDs of nodes on the shortest path between `source` and `target`.
// `source` and `target` can either be elements or IDs of elemements.
// `opt.weight` is an optional function returning a distance between two nodes.
// If `opt.directed` is `true`, the algorithm will take link direction into account.
joint.dia.Graph.prototype.shortestPath = function(source, target, opt) {

    opt = opt || {};

    var adjacencyList = {};
    _.each(this.getLinks(), function(link) {

        var sourceId = link.get('source').id;
        var targetId = link.get('target').id;
        if (!adjacencyList[sourceId]) {
            adjacencyList[sourceId] = [];
        }
        if (!adjacencyList[targetId]) {
            adjacencyList[targetId] = [];
        }
        
        adjacencyList[sourceId].push(targetId);
        if (!opt.directed) {
            adjacencyList[targetId].push(sourceId);
        }
    });

    var previous = joint.alg.Dijkstra(adjacencyList, source.id || source, opt.weight);

    var path = [];
    var u = target.id || target;
    if (previous[u]) path.push(u);
    while (u = previous[u]) {
        path.unshift(u);
    }
    return path;
};